		"id_str": "894431503463010304",
		"text": "\"즉 미세조정된 챗봇 기술은 전자상거래 상의 새로운 수익원을 창출할 수 있다는 것이다. 이 연구는 영국 소비자 다섯명 중 한명(21%)이 챗봇을 통해 물품과 서비스를 구매하는 것을 고려할 것이라고 응답한 것을 가리키고 있다.\"",
